import React, { useEffect } from "react";

const Admin2 = () => {
    const stdName = "SURENDHAR S";
    useEffect(() => {
        fetch(`http://localhost:3001/student/${stdName}`)
        .then((res) => res.json())
        .then((res) => console.log(res))
        .catch((err) => console.log(err))
    })
    return(
        <></>
    )
}

export default Admin2;
